  \"Extreme Environment Damage Index and Accumulation Model for CMC Laminate Fatigue
  Life Prediction Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T01:02:15.365622\",\n\t\"name\": \"extreme-environment-damage-index-and-accumulation-model-for-cmc-laminate-fatigue-life-pred\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Materials Research &amp; Design (MR&amp;D)
  is proposing in the SBIR Phase II an effort to develop a tool for predicting the
  fatigue life of C/SiC composite laminates, which incorporates mechanical loading
  at any minimum stress to maximum stress ratio (i.e., R value), at room and elevated
  temperatures, in either inert or oxidizing environments.  The success of this effort
  would represent a significant state-of-the-art improvement in fatigue projections
  of ceramic matrix composites, since no tools capable of accomplishing this have
  ever been developed.  The developed algorithm, implemented via user-defined subroutines
  operating within the ABAQUS public domain finite element software, will represent
  a significant new addition to the suite tools currently available to CMC designers.\",\n\t\"license_title\":
